7-atxl1.JPG","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/34/69/57-atxxl.JPG","width":650,"height":640},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/34/69/57-atxxl1.JPG","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://mybodyisaband.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/mybodyisaband?fref=ts","urlTwitter":"http://twitter.com/mybodyisaband","twitterScreenName":"mybodyisaband"}],"supports":[{"id":979771,"name":"Small Skies","startTime":null,"eventDescription":"Benjamin Tyler used to record under the name Stepkid, but he's morphed that project into the new Small Skies, enlisting the spontaneous contributions of friends to offset his carefully crafted, electronic-based sonic panoramas. Small Skies' intriguing debut album (self-titled) juxtaposes dark, coiled synths with booming, crashing live drums, and the results are both invigorating and ominous. For every joyous pop summit like "So Long," there's the wobbling, claustrophobic "New Home," and Tyler often overruns his melodies with echo, creating an indistinct, erased quality with his voice. What remains perfectly in focus is Tyler's piercing vision, and he injects a surprising amount of emotion into the abstractions on Small Skies, giving the record a gravity that's impossible to discount. NED LANNAMANN, PORTLAND MERCURY","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://smallskies.com/","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""},{"id":1750755,"name":"Small Million","startTime":null,"eventDescription":"Portland duo Small Million (Ryan Linder & Malachi Graham) met on the dance floor and got busy polishing their moody, lyrical synth pop. Rich, textured tracks with soaring melodies; wistful and cautiously optimistic.

